  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  text-align: center;
}
.i-do h2 {
  margin-bottom: 20px;
}
.i-do .discipline {
  width: 226px;
  text-align: center;
  padding: 20px 0;
  margin: 20px;
}
.i-do .discipline:first-child {
  margin-left: 0;
}
.i-do .discipline:last-child {
  margin-right: 0;
}
.i-do .discipline .fas {
  font-size: 2rem;
  color: #00b720;
}
.i-do .discipline h3 {
  margin-bottom: 0;
  margin-top: 10px;
}
.i-do .discipline p {
  margin-top: 20px;
  color: #666;
  font-size: 0.9rem;
}

